import React from 'react';
import PropTypes from 'prop-types';import {increaseActionFunc,decreaseActionFunc} from "./Action";

const Counter=({value,onIncClick,onDecClick})=>{
    return (
        <div>
            <span >{value}</span>
            <br />
            <button type="button" onClick={this.props.dispatch(increaseActionFunc())}>Increase</button>
            <button type="button" onClick={onDecClick}>Decrease</button>
        </div>
    )
};

Counter.propTypes = {
    value: PropTypes.number.isRequired,
    onIncClick: PropTypes.func.isRequired,
    onDecClick: PropTypes.func.isRequired
};

export default Counter;
